import React from 'react';
import './App.css';
import Jobs from "../src/Components/Jobs";

const mockJobs = [
  {
    title: 'SWE 1', company: 'Apple',
  },
  {
    title: 'SWE 2', company: 'Google',
  },
  {
    title: 'SWE 3', company: 'Facebook',
  }
]

function App() {
  return (
    <div className="App">
      <Jobs jobs={mockJobs}/>
    </div>
  );
}

export default App;
